¿CÓMO LUBRICAR UNA CADENA?
🔧Lubricar la cadena de la moto aporta flexibilidad al sistema de transmisión, reduce los tirones al cambiar de marcha y a su vez proporciona escasa fricción a la moto. 
Uno de los errores más comunes es aceitar la cadena de la moto sin previamente limpiarla.
 • Debemos eliminar suciedad, polvo, grasa, barro, y así alargamos su vida útil, para esto existen productos especiales desengrasantes o limpia cadenas, que podés adquirir en nuestro local o en su defecto usar kerosene, agua y cepillo.
 •Una vez la cadena esté limpia y seca, procedemos a aplicar el lubricante sobre la cadena y la corona de la rueda.
 •A la vez que lo aplicamos, debemos con la otra mano girar la rueda trasera lentamente para que se mueva la cadena y el producto penetre en todos los eslabones.
 🔗Siempre es recomendable dejar reposar la cadena lubricada unos 30 minutos

También debemos cerciorarnos que el lubricante que usemos sea específico para cadenas, especialmente para las que usan sello de goma. No aconsejando el uso de lubricantes generales.
Si no tienes el lubricante acorde, se puede usar aceite SAE 90-140.

Para ver el listado de lubricantes y limpia cadenas que tenemos ingresá a:
